var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro semantic zoom test object.
 * @param {Object} [props] Initializes a UIAPro Semantic Zoom test object using the supplied property bag.
 * @returns {SemanticZoom} the description object that was initialized.
 * @class SemanticZoom
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function SemanticZoom(props) {
    var semanticZoomDesc = new UiObjectBaseDescription("SemanticZoom");

    semanticZoomDesc._defineByPropertyBag(props);
    return semanticZoomDesc;
}

/**
 * A UIAPro semantic zoom.
 * @constructor
 * @class SemanticZoomTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function SemanticZoomTO(session, description) {
    description = description || SemanticZoom();
    var semanticZoomTO = new UiObjectBaseTO("UIAProSemanticZoom", session, description);

    return semanticZoomTO;
}

module.exports.SemanticZoomTO = SemanticZoomTO;
module.exports.SemanticZoom = SemanticZoom;